func TestListProducts(t *testing.T) {
  products, err := ParseProductJson(sampleJson)
  if err != nil {
    t.Errorf("Expected no errors parsing spree JSON, got %s", err)
  }
  if len(products) != 25 {
    t.Errorf("Expected 25 produts, got %d", len(products))
  }
  if products[0].Name != "Ruby on Rails Tote" {
    t.Errorf("Expected first product to be 'Ruby on Rails Tote', got '%s'", products[0].Name)
  }
}
